'''Jungle horrors''' are monsters that live on the island of [[Mos Le'Harmless]]. Players must have completed [[Cabin Fever]] to gain access to the island. They can be assigned as a [[Slayer]] task by [[Chaeldar]] and [[Vannaka]]. They are a weaker relative of the [[cave horror]]s that live inside the caves on the island. A [[Witchwood icon|Witchwood Icon]] is '''NOT''' required to kill Jungle Horrors.

