==Strengths and weaknesses==
Players with medium level [[Defence]] are advised to bring food ([[lobster]]s or better) and armour to negate the jungle horror's relatively accurate melee attacks.

Alternatively, players with a high Defence level can sustain themselves by cutting jungle horrors' commonly dropped [[pineapple]]s. Simply bring a [[knife]] to cut it into [[Pineapple ring|pineapple slices]]. This will heal 8 Hitpoints per pineapple.

There is a single spawn near the opening in the northern Mos Le'Harmless wall which will not run away when damaged from behind the wall and can thus be easily safespotted.

